INSERT INTO `blog` (`id`, `from_site`, `title`, `url`, `description`, `eventStart`, `eventEnd`, `embededFiles`, `authors`, `photo`, `blogDate`, `creator`) VALUES
(3,	'bs5',	'Ifip - Institut du porc',	'ifip---institut-du-porc',	'<p>La r&eacute;alisation du site web de l\'IFIP est un projet ambitieux qui n&eacute;cessite une connaissance approfondie du domaine et une expertise en d&eacute;veloppement web. Les fonctionnalit&eacute;s essentielles du site web incluent la recherche pertinante et rapide avec ElasticSearch, la connexion &agrave; des API &eacute;conomiques et la data visualisation avec PowerBI, la connexion avec une plateforme LMS pour l\'int&eacute;gration automatique de e-learning, la gestion des abonnements, un e-commerce, et une liaison avec un portail SIGB (Archimed) pour l\'int&eacute;gration unique de documents.</p>\r\n<p>La recherche pertinante et rapide est un &eacute;l&eacute;ment crucial pour le site web de l\'IFIP. Les utilisateurs doivent pouvoir trouver facilement les informations qu\'ils recherchent sans avoir &agrave; passer par des pages de r&eacute;sultats inutiles. ElasticSearch est une technologie de recherche open source qui permet une recherche de texte int&eacute;grale rapide et pr&eacute;cise. Il est con&ccedil;u pour &ecirc;tre utilis&eacute; comme moteur de recherche pour les sites web, les applications et les bases de donn&eacute;es. Avec ElasticSearch, les utilisateurs de l\'IFIP peuvent rechercher des informations sur l\'ensemble du site web, y compris les articles, les documents, les vid&eacute;os, les infographies et bien plus encore.</p>\r\n<p>La connexion &agrave; des API &eacute;conomiques et la data visualisation avec PowerBI sont des fonctionnalit&eacute;s avanc&eacute;es qui permettent &agrave; l\'IFIP de fournir des informations pr&eacute;cieuses aux utilisateurs. Les API &eacute;conomiques sont des interfaces de programmation qui permettent aux d&eacute;veloppeurs de r&eacute;cup&eacute;rer des donn&eacute;es &eacute;conomiques et financi&egrave;res. PowerBI est une plateforme de business intelligence qui permet aux utilisateurs de visualiser les donn&eacute;es de mani&egrave;re graphique et interactive. En connectant les API &eacute;conomiques &agrave; PowerBI, les utilisateurs de l\'IFIP peuvent visualiser les donn&eacute;es &eacute;conomiques importantes telles que les indices, les taux de change, les indicateurs financiers, etc. Ils peuvent &eacute;galement personnaliser leurs tableaux de bord et leurs rapports selon leurs besoins.</p>\r\n<p>La connexion avec une plateforme LMS pour l\'int&eacute;gration automatique de e-learning est une fonctionnalit&eacute; importante pour l\'IFIP. Les utilisateurs peuvent suivre des cours en ligne sur une vari&eacute;t&eacute; de sujets li&eacute;s &agrave; la charcuterie et &agrave; la viande. La plateforme LMS est un syst&egrave;me de gestion de l\'apprentissage qui permet aux utilisateurs de suivre des cours en ligne, de passer des examens et d\'obtenir des certificats de r&eacute;ussite. Avec l\'int&eacute;gration automatique de e-learning, les utilisateurs peuvent acc&eacute;der aux cours directement depuis le site web de l\'IFIP et suivre leur progression sans avoir &agrave; se connecter &agrave; une autre plateforme.</p>\r\n<p>La gestion des abonnements est une autre fonctionnalit&eacute; cl&eacute; du site web de l\'IFIP. Les utilisateurs peuvent s\'abonner &agrave; des newsletters, des bulletins d\'information et des alertes de veille. La gestion des abonnements permet &eacute;galement aux utilisateurs de mettre &agrave; jour leurs informations de contact et de g&eacute;rer leurs pr&eacute;f&eacute;rences d\'abonnement.</p>\r\n<p>L\'e-commerce est une fonctionnalit&eacute; importante pour l\'IFIP. Les utilisateurs peuvent acheter des publications, des livres et des formations directement depuis le site web. L\'e-commerce permet aux utilisateurs de payer en ligne, de suivre leur commande et de recevoir des mises &agrave; jour en temps r&eacute;el.</p>\r\n<p>La liaison avec le portail SIGB Archimed permet d\'int&eacute;grer les documents sur la charcuterie et la viande dans une seule base de donn&eacute;es. Cela signifie que les utilisateurs peuvent rechercher et acc&eacute;der &agrave; des documents tels que des livres, des revues, des rapports, des vid&eacute;os et des infographies directement depuis le site web de l\'IFIP, sans avoir &agrave; se connecter &agrave; une autre plateforme.</p>\r\n<p>Le projet de cr&eacute;ation du site web de l\'IFIP rev&ecirc;t une grande importance pour l\'industrie de la charcuterie et de la viande. En offrant un acc&egrave;s facile &agrave; des informations de qualit&eacute;, le site permet aux professionnels et aux consommateurs de prendre des d&eacute;cisions plus &eacute;clair&eacute;es sur l\'utilisation et la consommation de ces produits. De plus, la conduite du projet avec une approche int&eacute;gr&eacute;e et une utilisation efficace des technologies modernes telles que ElasticSearch, PowerBI et Archimed permettent d\'optimiser la gestion des ressources et de maximiser l\'impact du site. En somme, la cr&eacute;ation du site web de l\'IFIP est une initiative majeure pour l\'industrie de la charcuterie et de la viande et t&eacute;moigne de la capacit&eacute; de l\'IFIP &agrave; innover et &agrave; s\'adapter aux exigences de son environnement.</p>',	'',	'',	'',	NULL,	'ifip-main.jpg',	'2023-04-27 00:50:35',	'Michael HEILIKMAN'),
(2,	'bs5',	'Code des usages de la charcuterie',	'code-des-usages-de-la-charcuterie',	'<p>La r&eacute;alisation d\'un site web \"from scratch\" pour le <a href=\"https://www.code-des-usages-charcuterie.fr/\" target=\"_blank\" rel=\"noopener\">Code des usages de la charcuterie</a> est une t&acirc;che complexe mais passionnante. La charcuterie est un domaine vaste et diversifi&eacute; qui exige une recherche approfondie et une gestion minutieuse des informations pour offrir une exp&eacute;rience utilisateur satisfaisante. Dans cet article, nous allons explorer les diff&eacute;rentes fonctionnalit&eacute;s du site web, notamment la recherche pond&eacute;r&eacute;e, le backoffice, les m&eacute;dias, la gestion des utilisateurs et le menu inspir&eacute; de celui de D&eacute;cathlon pour la recherche de fiches.</p>\r\n<p>La recherche pond&eacute;r&eacute;e est une fonctionnalit&eacute; essentielle pour le site web de la charcuterie. Elle permet &agrave; l\'utilisateur de trouver facilement les informations dont il a besoin. L\'algorithme de pond&eacute;ration utilise des crit&egrave;res sp&eacute;cifiques tels que le nom du produit, le lieu de production, les ingr&eacute;dients, la texture, la saveur, etc. pour classer les r&eacute;sultats de recherche par ordre de pertinence. La recherche pond&eacute;r&eacute;e permet &eacute;galement d\'afficher des r&eacute;sultats similaires pour les produits qui ont des noms ou des ingr&eacute;dients proches.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" width=\"60%\"></p>\r\n<p>Le backoffice est un espace r&eacute;serv&eacute; aux administrateurs pour g&eacute;rer les diff&eacute;rents produits du site web. Il permet d\'ajouter, de modifier et de supprimer des produits, d\'&eacute;diter les informations, de g&eacute;rer les images et de publier les nouvelles fiches de produits. Le backoffice permet &eacute;galement de g&eacute;rer les utilisateurs du site web et de d&eacute;finir les diff&eacute;rents niveaux d\'acc&egrave;s en fonction des besoins de l\'entreprise.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" width=\"60%\"></p>\r\n<p>Les m&eacute;dias sont une partie importante du site web de la charcuterie. Ils permettent de pr&eacute;senter les diff&eacute;rents produits sous diff&eacute;rents angles et d\'illustrer les diff&eacute;rentes &eacute;tapes de la production. Les m&eacute;dias peuvent inclure des photos, des vid&eacute;os, des infographies et des animations. Les m&eacute;dias sont essentiels pour offrir une exp&eacute;rience utilisateur immersive et permettre aux utilisateurs de mieux comprendre les produits de charcuterie.</p>\r\n<p>La gestion des utilisateurs est une autre fonctionnalit&eacute; importante du site web. Elle permet de cr&eacute;er et de g&eacute;rer les comptes des utilisateurs, d\'attribuer des r&ocirc;les et des autorisations, de g&eacute;rer les pr&eacute;f&eacute;rences de compte et de stocker les donn&eacute;es de profil. La gestion des utilisateurs est essentielle pour offrir une exp&eacute;rience personnalis&eacute;e aux utilisateurs et pour garantir la s&eacute;curit&eacute; des donn&eacute;es.</p>\r\n<p>Le menu inspir&eacute; de celui de D&eacute;cathlon pour la recherche de fiches est une fonctionnalit&eacute; pratique pour les utilisateurs. Il permet de trier les fiches produits en fonction de diff&eacute;rents crit&egrave;res tels que le prix, le lieu de production, la saveur, etc. Le menu offre une exp&eacute;rience de recherche simplifi&eacute;e pour les utilisateurs et permet de trouver rapidement les fiches produits correspondantes.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" width=\"60%\"></p>\r\n<p>En r&eacute;sum&eacute;, la r&eacute;alisation d\'un site web en PHP \"from scratch\" pour les usages de la charcuterie n&eacute;cessite une connaissance approfondie du domaine, une expertise en d&eacute;veloppement web et une bonne gestion de projet. Les fonctionnalit&eacute;s de recherche pond&eacute;r&eacute;e, de backoffice, de m&eacute;dias, de gestion des utilisateurs et de menu inspir&eacute; de celui de D&eacute;cathlon pour la recherche de fiches sont essentielles pour offrir une exp&eacute;rience utilisateur satisfaisante. Le site web de la charcuterie doit &eacute;galement &ecirc;tre convivial, intuitif, esth&eacute;tique et fonctionnel pour r&eacute;pondre aux attentes des utilisateurs et de l\'entreprise.</p>',	'',	'',	'',	NULL,	'cdu-main.jpg',	'2023-04-27 00:19:23',	'Michael HEILIKMAN'),
(4,	'bs5',	'Journes de la recherche porcine',	'journees-de-la-recherche-porcine',	'<p>Le site web des Journ&eacute;es de la Recherche Porcine est un projet d\'envergure qui rev&ecirc;t une grande importance pour l\'industrie porcine. Ce site web, d&eacute;velopp&eacute; en PHP, permet la communication sur le congr&egrave;s annuel et offre de nombreuses fonctionnalit&eacute;s pratiques pour les participants, les sponsors et les organisateurs.</p>\r\n<p>L\'affichage d&eacute;taill&eacute; du planning permet aux participants de se tenir inform&eacute;s des diff&eacute;rents &eacute;v&eacute;nements et des conf&eacute;rences pr&eacute;vus lors du congr&egrave;s. Cela permet de maximiser leur exp&eacute;rience et de garantir que chacun puisse assister aux conf&eacute;rences qui l\'int&eacute;ressent.</p>\r\n<p>La gestion de la base de donn&eacute;es depuis 1961 est une prouesse consid&eacute;rable, qui t&eacute;moigne de l\'importance de l\'&eacute;v&eacute;nement et de la n&eacute;cessit&eacute; de conserver une trace de toutes les &eacute;ditions pr&eacute;c&eacute;dentes. Cette base de donn&eacute;es permet de retracer l\'historique des Journ&eacute;es de la Recherche Porcine, de comprendre l\'&eacute;volution de l\'industrie porcine et de faciliter la planification des futurs congr&egrave;s.</p>\r\n<p>L\'inscription en ligne pour les participants et les sponsors est une fonctionnalit&eacute; pratique et efficace qui permet d\'optimiser l\'organisation du congr&egrave;s et de r&eacute;duire les co&ucirc;ts li&eacute;s &agrave; la gestion des inscriptions. Les participants peuvent facilement s\'inscrire en ligne et les sponsors peuvent choisir leur niveau de participation et effectuer leur paiement en ligne.</p>\r\n<p>En somme, le site web des Journ&eacute;es de la Recherche Porcine est un outil de communication essentiel pour l\'industrie porcine, qui facilite l\'organisation du congr&egrave;s annuel et am&eacute;liore l\'exp&eacute;rience des participants. La gestion de la base de donn&eacute;es depuis 1961 t&eacute;moigne de l\'importance historique de cet &eacute;v&eacute;nement, tandis que l\'inscription en ligne et la fonctionnalit&eacute; de planning d&eacute;taill&eacute; permettent une gestion efficace et &eacute;conomique du congr&egrave;s.</p>',	'',	'',	'',	NULL,	'jrp-main.jpg',	'2023-04-27 01:15:06',	'Michael HEILIKMAN'),
(5,	'bs5',	'Gestionnaire de projets',	'gestionnaire-de-projets',	'<p>La cr&eacute;ation d\'un gestionnaire de projet scientifique est une initiative importante qui peut faciliter la collaboration entre les membres du projet, ainsi que l\'organisation et la gestion des documents li&eacute;s au projet.</p>\r\n<p>Le gestionnaire de document est un syst&egrave;me qui permet aux membres du projet d\'administrer et d\'ajouter des documents dans un site web d&eacute;di&eacute; au projet. Les membres peuvent &eacute;galement partager les documents avec d\'autres membres du projet et y acc&eacute;der facilement &agrave; tout moment.</p>\r\n<p>Le calendrier est une fonctionnalit&eacute; essentielle qui permet de planifier et d\'organiser les diff&eacute;rentes &eacute;tapes du projet. Les membres peuvent y ajouter les dates importantes, les &eacute;ch&eacute;ances et les &eacute;v&eacute;nements, afin de suivre l\'avancement du projet et de garantir que toutes les t&acirc;ches sont r&eacute;alis&eacute;es en temps voulu.</p>\r\n<p>Les actualit&eacute;s sont &eacute;galement une fonctionnalit&eacute; utile, qui permet de tenir les membres du projet inform&eacute;s des derni&egrave;res avanc&eacute;es et des changements dans le projet. Cette fonctionnalit&eacute; permet &eacute;galement de communiquer avec les membres et de faciliter la collaboration et la prise de d&eacute;cision.</p>\r\n<p>Le chat par dossier est une fonctionnalit&eacute; pratique qui permet aux membres du projet de communiquer en temps r&eacute;el sur des dossiers sp&eacute;cifiques. Cette fonctionnalit&eacute; facilite la communication entre les membres et permet d\'&eacute;viter les confusions et les erreurs dans le projet.</p>\r\n<p>En 2023, le projet &eacute;voluera avec l\'ajout d\'un nouveau syst&egrave;me de cr&eacute;ation de pages pour la diffusion d\'informations destin&eacute;es au public. Cette nouvelle fonctionnalit&eacute; permettra de communiquer facilement et efficacement avec le public, en fournissant des informations sur les avanc&eacute;es et les r&eacute;sultats du projet.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" width=\"70%\"></p>\r\n<p>En plus des fonctionnalit&eacute;s mentionn&eacute;es pr&eacute;c&eacute;demment, le gestionnaire de document pour la conduite d\'un projet scientifique peut &eacute;galement utiliser la librairie AMChart pour l\'affichage d\'analytics. Cette librairie permet de cr&eacute;er des graphiques et des tableaux interactifs pour visualiser les donn&eacute;es li&eacute;es au projet. Cela peut &ecirc;tre utile pour suivre l\'&eacute;volution du projet, analyser les donn&eacute;es et prendre des d&eacute;cisions &eacute;clair&eacute;es.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\"></p>\r\n<p>De plus, la connexion &agrave; l\'API Sendinblue peut &ecirc;tre utilis&eacute;e pour la diffusion de newsletters. Cette API permet d\'envoyer des newsletters &agrave; une liste de contacts, de suivre les r&eacute;sultats et de personnaliser les messages en fonction des int&eacute;r&ecirc;ts des destinataires. Cela peut &ecirc;tre utile pour tenir les membres du projet et les parties prenantes inform&eacute;s des derni&egrave;res avanc&eacute;es, des &eacute;v&eacute;nements &agrave; venir et des r&eacute;sultats du projet.</p>',	'',	'',	'',	NULL,	'filarmoni-main.jpg',	'2023-04-27 01:41:48',	'Michael HEILIKMAN');
INSERT INTO `blog` (`id`, `from_site`, `title`, `url`, `description`, `eventStart`, `eventEnd`, `embededFiles`, `authors`, `photo`, `blogDate`, `creator`) VALUES
(6,	'bs5',	'Prototypage Figma',	'prototypage-figma',	'<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" width=\"70%\"></p>\r\n<p>Figma est un outil de prototypage de conception d\'interface utilisateur qui a rapidement gagn&eacute; en popularit&eacute; ces derni&egrave;res ann&eacute;es. Il offre de nombreuses fonctionnalit&eacute;s puissantes pour les designers, notamment l\'auto-layout et les composants.</p>\r\n<p>L\'auto-layout est un outil indispensable pour les designers qui souhaitent cr&eacute;er des interfaces utilisateur responsives. En effet, il permet de d&eacute;finir des r&egrave;gles de disposition pour les &eacute;l&eacute;ments de l\'interface, afin qu\'ils s\'adaptent automatiquement aux diff&eacute;rentes tailles d\'&eacute;cran. Cela permet de gagner du temps et d\'assurer une coh&eacute;rence visuelle sur l\'ensemble de l\'interface.</p>\r\n<p>Les composants sont &eacute;galement un outil essentiel dans la bo&icirc;te &agrave; outils de Figma. Ils permettent de cr&eacute;er des &eacute;l&eacute;ments d\'interface r&eacute;utilisables, qui peuvent &ecirc;tre copi&eacute;s et coll&eacute;s dans diff&eacute;rentes parties de l\'interface. Cela permet de gagner du temps et de maintenir une coh&eacute;rence visuelle sur l\'ensemble de l\'interface.</p>\r\n<p>En combinant l\'auto-layout et les composants, les designers peuvent cr&eacute;er des interfaces utilisateur hautement personnalis&eacute;es et adapt&eacute;es &agrave; leurs besoins. Cela permet &eacute;galement de r&eacute;aliser des tests utilisateurs plus rapidement et plus efficacement. En effet, gr&acirc;ce &agrave; la fonctionnalit&eacute; de prototypage de Figma, les designers peuvent facilement cr&eacute;er des maquettes interactives et les tester avec des utilisateurs r&eacute;els. Les retours d\'exp&eacute;rience des utilisateurs peuvent alors &ecirc;tre pris en compte pour am&eacute;liorer l\'interface et assurer une exp&eacute;rience utilisateur optimale.</p>\r\n<p>En conclusion, Figma est un outil exceptionnel pour la r&eacute;alisation de tests utilisateurs gr&acirc;ce &agrave; ses fonctionnalit&eacute;s avanc&eacute;es telles que l\'auto-layout et les composants. Les designers peuvent ainsi cr&eacute;er des interfaces hautement personnalis&eacute;es, coh&eacute;rentes et responsives en un temps record. Les tests utilisateurs peuvent &eacute;galement &ecirc;tre r&eacute;alis&eacute;s plus facilement et plus rapidement, permettant aux designers d\'adapter l\'interface aux besoins et aux retours d\'exp&eacute;rience des utilisateurs.</p>',	'',	'',	'',	NULL,	'figma-cover.png',	'2023-04-27 01:47:36',	'Michael HEILIKMAN');

DROP TABLE IF EXISTS `category`;
CREATE TABLE `category` (
  `cat_id` int(11) NOT NULL AUTO_INCREMENT,
  `from_site` varchar(60) NOT NULL,
  `cat_name` mediumtext NOT NULL,
  `cat_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`cat_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `chatbox`;
CREATE TABLE `chatbox` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `author` varchar(255) NOT NULL,
  `texte` longtext NOT NULL,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `doc_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `docs`;
CREATE TABLE `docs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `toolDesc` longtext,
  `toolProd` longtext,
  `toolType` longtext,
  `toolTarget` longtext,
  `toolLink` longtext,
  `imgBase64` longtext,
  `folderType` varchar(255) DEFAULT NULL,
  `fileDate` varchar(255) DEFAULT NULL,
  `fileDoc` varchar(255) DEFAULT NULL,
  `typeDoc` varchar(100) DEFAULT NULL,
  `sizeDoc` int(11) DEFAULT NULL,
  `from_site` varchar(255) NOT NULL,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `fileUpdate` varchar(255) DEFAULT NULL,
  `created_by` varchar(255) DEFAULT NULL,
  `active` int(11) DEFAULT NULL,
  `parent_id` varchar(255) DEFAULT NULL,
  `item_order` int(4) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `entreprises`;
CREATE TABLE `entreprises` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `from_site` varchar(255) NOT NULL,
  `entreprise` varchar(255) NOT NULL,
  `gouvernance` varchar(255) DEFAULT NULL,
  `adresse` varchar(255) NOT NULL,
  `cp` varchar(10) NOT NULL,
  `ville` varchar(255) NOT NULL,
  `num_TVA` varchar(255) DEFAULT NULL,
  `dateDebut` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `events`;
CREATE TABLE `events` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `eventDate` varchar(60) NOT NULL,
  `eventTexte` longtext NOT NULL,
  `from_site` varchar(255) NOT NULL,
  `eventTime` varchar(50) NOT NULL,
  `eventTimeEnd` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `newsletter`;
CREATE TABLE `newsletter` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `from_site` varchar(60) NOT NULL,
  `news_prenom` varchar(255) DEFAULT NULL,
  `news_nom` varchar(255) DEFAULT NULL,
  `news_mail` text,
  `news_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `online`;
CREATE TABLE `online` (
  `visitor_id` int(11) NOT NULL AUTO_INCREMENT,
  `from_site` varchar(60) NOT NULL,
  `visitor_ip` varchar(255) NOT NULL,
  `country` varchar(255) DEFAULT NULL,
  `countryCode` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL,
  `longitude` varchar(255) DEFAULT NULL,
  `pageView` longtext,
  `pageReferer` varchar(255) NOT NULL,
  `time` int(11) NOT NULL,
  `visitor_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`visitor_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `pages`;
CREATE TABLE `pages` (
  `page_id` int(11) NOT NULL,
  `from_site` varchar(60) NOT NULL,
  `page_type` varchar(255) DEFAULT NULL,
  `page_category` mediumtext,
  `titre` longtext,
  `page_url` longtext,
  `photo` longtext,
  `authors` varchar(60) NOT NULL,
  `embededFiles` longtext,
  `active` int(2) NOT NULL DEFAULT '0',
  `page_update` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `page_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`page_id`)
